  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a polygon coverage created
  in ARC/INFO that represents the generalized thickness of the Minnelusa Formation,
  Black Hills, South Dakota. The thickness of the Minnelusa Formation was determined
  by substracting the elevation of the top of the Madison Limestone from the elevation
  of the top of the Minnelusa Formation. The elevations for the tops of the formations
  were determined from geologic logs for wells drilled as of 1998. The thickness coverage
  contains polygons that have single integer values representing a range of thickness.\",\n\t\"license_title\":
